import './App.css';
import Navbar from './layouts/Navbar'
import {Context} from './Context'
import axios from 'axios'
import { useEffect, useState } from 'react';
axios.defaults.withCredentials = true
function App() {

  const [verify,setverify] = useState()


  useEffect(() => {
  axios.get("http://localhost:4100/register/loggedIn").then(res => {
    setverify(res.data)
  }).catch(err => {
    console.log(err)
  })
  },[])



  return (
    <div className="App">

      <Context.Provider>

        {
          verify ? (
            <div>
            <Navbar/>
            </div>
          ) : (
            <h1>Hop</h1>



          )
        }







      </Context.Provider>









    </div>
  );
}

export default App;
